import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Banner from "./components/Banner";
import Home from "./pages/Home";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={
            <Banner title={"Employee"}>
              <Home />
            </Banner>
          }
        />
        <Route
          path="/executives"
          element={
            <Banner title={"Executives"}>
              <Home />
            </Banner>
          }
        />
        <Route
          path="/mid"
          element={
            <Banner title={"Mid Management"}>
              <Home />
            </Banner>
          }
        />
        <Route
          path="/juniors"
          element={
            <Banner title={"Juniors"}>
              <Home />
            </Banner>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
